sql.query:
INSERT INTO menus (id, name, restaurant_id, description)
 SELECT id, name, restaurant_id, description
   FROM tmp_menus;

INSERT INTO categories (id, name, menu_id, description)
 SELECT id, name, menu_id, description
   FROM tmp_categories;

INSERT INTO menu_items (id, name, price, category_id, description)
 SELECT id, name, price, category_id, description
   FROM tmp_menu_items;

INSERT INTO orders (id, placed_on, menu_item_id, quantity, discount_id, comment)
 SELECT id, placed_on, menu_item_id, quantity, discount_id, comment
   FROM tmp_orders;

INSERT INTO customers (id, created_at, updated_at, name, email, phone, city_id)
 SELECT id, created_at, updated_at, name, email, phone, city_id
   FROM tmp_customers;

INSERT INTO order_status (id, transitioned_at, status, order_id, customer_id, restaurant_id, driver_id)
 SELECT id, transitioned_at, status, order_id, customer_id, restaurant_id, driver_id
   FROM tmp_order_status;

INSERT INTO drivers (id, created_at, updated_at, name, email, phone, car_make, car_model, car_year, car_color, car_license_plate)
 SELECT id, created_at, updated_at, name, email, phone, car_make, car_model, car_year, car_color, car_license_plate
   FROM tmp_drivers;

INSERT INTO restaurants (id, created_at, updated_at, name, email, address, phone, city_id, business_hours_id, description)
 SELECT id, created_at, updated_at, name, email, address, phone, city_id, business_hours_id, description
   FROM tmp_restaurants;
